import React from 'react';

const Contact = () => {
  return (
    <div className='Contact'>
        <div className='leftSide' style={{backgroundImage: `url(${BannerImage})`}}/>
        <div className='rightSide'>
            <h1> Contact us</h1>
            <form></form>
        </div>
    </div>
  );
}

export default Contact;
